import React from 'react'
import style from 'styled-components'
const Header = style.p`
    font-size: 45px;
    font-weight: bold;
    font-family: 'Mali', cursive;
    color: #9BBEE8;
`
export default () => (
    <div>
    <Header> เค้าเดฟนะ *w* </Header>
    </div>
)
